import React from 'react';
import './Task_css.css';




function Moviedetails(props) {

  return (
 <>
   <div className="container  alert-primary mb-2" >


		  {props.id===610253 && <h5 className="text-success" key={props.id}>{props.title}(6.8/10)</h5>}
		  {props.id===646385 && <h5 className="text-success" key={props.id}>{props.title}(7.3/10)</h5>}
	{props.id===585245 && <h5 className="text-success" key={props.id}>{props.title}</h5>}
		  {props.id===438695 && <h5 className="text-success"  key={props.id}>{props.title}(8.3/10)</h5>}
